import React from 'react'

export default function MovieSearch(props) {
    const {original_title,overview,popularity,release_date}= props.DataTrans
  
  return (
    <div>
      <div><h3>{original_title}</h3></div>  
       <div>{overview}</div> 
<div>{popularity}</div>
<div>{release_date}</div>
    </div>
  )
}
